style.css:
@-moz-document domain("roblox.com") {
@keyframes wobbler {
  0% {
    transform: rotate(-5deg);
        content: "The game is loading umm uh ?";
  }
  50% {
    transform: rotate(5deg);
    content: "The game is loading umm uh ??";
  }
  100% {
    transform: rotate(-5deg);
     content: "The game is loading umm uh ???";
  }
}

.modal-dialog .modal-content .modal-body p {
    font-size:0px;
  	animation: wobbler 4s infinite;
}
.modal-dialog .modal-content .modal-body p:before {
    font-size:16px;
    line-height: 1.5em;
    content: "The game is loading umm uh";
  	animation: ChangeText 2s infinite;
  	animation: wobbler 2s infinite;
}
}
